import Frame from './frame.js';

import './introduce.css';
function Introduce(){
    return (
        <div>
            <Frame/>
            <div id="banner">
                <h2>서비스 소개</h2>
                <img src="bannerRoad.png"/>
            </div>
        </div>

    );
}


export default Introduce;
